 import React from "react";

 export default function Test4({fruits}){
    const check = function() {
      return  fruits.map(function(fruits){
            return (
            <h1 className="ffruit">{fruits}</h1>
            )
        })
    };
    
    return(
        <>
        {check()}
        </>
    )
 }
